import React from 'react';
import {Header} from './header';
import {Footer} from './footer';
import {Main} from './main';

export class Users extends React.Component {
    render() {
       const data = this.props.data;
        return (
            <li>
                <Header />
                <Main  />
                <Footer />
                {data.name}

          </li>      
        )
    }

}
